var max int

func lengthOfLongestSubstring(s string) int {
	max=0

	//sr:=[]rune(s)

	m:=make(map[byte]int,len(s))
	for i,c:=range s{
		pos,ok:=m[byte(c)]
		if !ok{
			m[byte(c)]=i
			continue
		}

		if len(m)>max{
			max=len(m)
		}
		//deleteMap(m,pos)
		for k,v:=range m{
			if v<=pos{
				delete(m,k)
			}
		}
		//m=make(map[rune]int)
		m[byte(c)]=i
	}


	if len(m)>max{
		max=len(m)
	}

	return max
}

func deleteMap(m map[byte]int, i int){
	fmt.Println(time.Now())
	for k,v:=range m{
		if v<=i{
			delete(m,k)
		}
	}
	fmt.Println(time.Now())
}

